// 現在のページを取得する。
var page = Forguncy.Page;
// リストビューオブジェクトを取得する。
var listview = page.getListView("物件商品ビュー");
// リストビューのカレント行を取得する。
var index = listview.getSelectedRowIndex();
// 添付ファイルの値を取得する
var tmpVal = listview.getValue(index, "添付ファイル");  

if (tmpVal !== null) {
    //NFC変換
    var normalized = tmpVal.normalize("NFC");
    listview.setValue(index, "変換ファイル", normalized);
}
